import React, { Component } from 'react'
import Layout from '../components/layout.js'


const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
}

export default function Layout2(props) {
  return (
    <Layout>
      <Layout2>
    <div style={layoutStyle}>
      {props.children}
    </div>
    </Layout2>
    </Layout>
  )
}
